    false,nt"url": null,nt"notes": "This planning and accomplishment report
    for Des Lacs National Wildlife Refuge outlines Refuge activities from January 1st
    through June 30th, 1973. The report begins by summarizing the weather conditions,
    habitat conditions, and notable events at the Refuge. Wildlife and wildland interpretation
    and recreation- including trails, tour routes, environmental education, visitor
    use, and camping - is also covered. Information on Refuge activities concerning
    biological monitoring, bird banding, and grazing is included.  This report shows
    progress by percent accomplished of planed wildlife-wildland projects, such as number
    of trails built.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
